Nora Roberts (born Eleanor Marie Robertson on October 10, 1950) is an American bestselling author of more than 209 romance novels. She writes as J.D. Robb for the &quot;In Death&quot; series, and has also written under the pseudonyms Jill March and for publications in the UK as Sarah Hardesty.

Nora Roberts was the first author to be inducted into the Romance Writers of America Hall of Fame. As of 2011, her novels had spent a combined 861 weeks on the New York Times Bestseller List, including 176 weeks in the number-one spot.

